import React from 'react'
import menu from './imagens/menu.JPG'
import logo from './imagens/logo.JPG'


export default function Header() {
  return (
    <div>
        <button><img src={menu}/></button>
        <button><img src={logo}/></button>
        <input>Pesquisar</input>
        <button><img src={menu}/></button>
    </div>
  )
}
